import Box from '@mui/material/Box';
import Grid from '@mui/material/Grid';
import login from '../assets/login-banner-2.jpg';
import TextField from '@mui/material/TextField';
import { makeStyles } from '@mui/styles';

  const useStyle = makeStyles(theme => ({
      textCenter: {
          textAlign: 'center',
          color:theme.palette.primary.light
      },
      loginImg:{
          maxWidth: '100%',
          width: '700px',
          height:'100vh',
          backgroundImage: url('lo')
      }
  }));
const Home = () => {
    const classCust = useStyle();
    return (<div>
        <Box sx={{ flexGrow: 1 }}>
            <Grid container rowSpacing={3}>
                <Grid item xs = {12} md = {6} className='loginImg'>
                    {/* <div>
                        <img src={login} alt="login-image" md= {6} className={classCust.loginImg}/>
                    </div> */}
                </Grid>
                <Grid item xs = {12} md = {6}>
                        <div>
                        <h3 className={classCust.textCenter} >Go to XMT Website</h3>
                        <p>Welcome Back!</p>
                        <div>
                            <form >
                                <div>
                                    <label>
                                        Email Address/Username
                                    </label>
                                    <TextField id="outlined-basic" label="Outlined" variant="outlined" />
                                </div>
                            </form>
                        </div>
                    </div>
                </Grid>
            </Grid>
        </Box>
    </div>);
}
export default Home;
